        <Thead>
          <Tr>
            <Th style={{ width: '150px' }}>{columnNames.device_name}</Th>
            <Th style={{ width: '150px' }}>{columnNames.name}</Th>
            <Th>{columnNames.branches}</Th>
            <Th>{columnNames.prs}</Th>
            <Th>Logs</Th>
            <Th>Files</Th>
          </Tr>
        </Thead>
